import React, { useCallback, useEffect, useState } from "react";
import axios from "axios";

const Main = () => {
  const [users, setUsers] = useState([]);

  const onFetchUsers = useCallback(() => {
    axios({
      method: "GET",
      url: "https://jsonplaceholder.typicode.com/users"
    }).then((res) => {
      setUsers(res.data);
    });
  }, []);

  useEffect(() => {
    onFetchUsers();
  });

  return <div></div>;
};

export default Main;
